import React from 'react';

export default () => (
  <svg width="1em" height="1em" viewBox="0 0 12 12" version="1.1">
    <g stroke="none" strokeWidth="1" fill="currentColor" fillRule="evenodd">
      <ellipse cx="6" cy="6" rx="6" ry="4" />
    </g>
  </svg>
);
